import React from 'react';

import './App.css';
import { Switch, Route } from 'react-router-dom'
import Game from "./Screen/Game";
import SplashScreren from './Screen/SplashScreen';
import MainMenu from './Screen/MainMenu';
import './Screen/GameStyles.scss'
import WinDisplay from './Components/Game-Components/WinDisplay'
import HealthBar from './Components/Game-Components/HealthBar'
import DisplayName from './Components/Game-Components/DisplayName'


function App() {
  return (
    <div className="App">
      <div className="hud">
        <div className="display-name" >
          <DisplayName className="display-name" serName='king' />
        </div>
        <div className="win-display">
          <WinDisplay wins={1} />
        </div>
        <div className="health-bar">
          <HealthBar health={10} />
        </div>
      </div>



    </div>
  );
}

export default App;
